import { useState } from "react";
import Player from "./types/player";

export const usePlayers = () => {

  const [ players, setPlayers ] = useState(<Player[]>[
    { name: "Olli" },
    { name: "Matti"},
    { name: "Tatti"}
  ]);
  
 return {
   players : players,
   setPlayers : setPlayers
 };
}
